    <div className="demo-video-placeholder">
      <span style={{
        display: 'inline-block',
        width: 60,
        height: 60,
        borderRadius: '50%',
        background: '#f3f4f6',
        display: 'flex',
        alignItems: 'center',
        justifyContent: 'center',
        fontSize: 32,
        margin: '24px auto'
      }}>▶️</span>
    </div>
  </section>
);

